import React from 'react';
import app from '../styles/LandingPage.module.css';
import CarouselCard from './CarouselCard';

const Carousel = ({ users }) => {
  return (
    <div className={app['content--carousel']}>
      { [...new Array(users)].map(item => <CarouselCard />) }
      <div className={app['carousel__controllers']}>
        {[...new Array(users)].map(item => <div className={app['carousel__controller']}></div>) }
        
        <div className={app['carousel__controller--on']}></div>
        <div className={app['carousel__controller']}></div>
        <div className={app['carousel__controller']}></div>
      </div>
    </div>
  )
}

export default Carousel;
